import React from 'react';
import MenuCard from '../menuCard/MenuCard';
import './style.css';

export default function MenuCardList() {
  return (
    <div className="menu_card_list">
      <MenuCard
        get_pictureUrl="url_to_breakfast_image"
        get_menuName="조식"
        get_state={false}
        get_bestComment="아주 맛있어요!"
        get_likes={100}
        get_dislikes={5}
      />
      <MenuCard
        get_pictureUrl="url_to_menu1_image"
        get_menuName="메뉴1"
        get_state={true}
        get_bestComment="정말 좋았습니다."
        get_likes={150}
        get_dislikes={3}
      />
      <MenuCard
        get_pictureUrl="url_to_menu2_image"
        get_menuName="메뉴2"
        get_state={false}
        get_bestComment="최고였어요!"
        get_likes={200}
        get_dislikes={10}
      />
      <MenuCard
        get_pictureUrl="url_to_salad_image"
        get_menuName="샐러드"
        get_state={true}
        get_bestComment="아주 신선해요!"
        get_likes={80}
        get_dislikes={2}
      />
      <MenuCard
        get_pictureUrl="url_to_staff_cafeteria_image"
        get_menuName="교직원식당"
        get_state={true}
        get_bestComment="좋은 선택이었어요."
        get_likes={130}
        get_dislikes={4}
      />
    </div>
  );
}
